import React, {Component} from "react";

class Pokemon extends Component{
  state={
    pokeName:""
  };

  getPokemon = () => {
    let requestOptions = {
      method: 'GET',
      redirect: 'follow'
    };
    fetch("https://pokeapi.co/api/v2/pokemon/?limit=151", requestOptions)
    .then(response => response.json())
    .then(name => this.setState({pokeName: name}))
    .catch(error => console.log('error', error));
  }

render(){
  return(
    <div>
      <p>Pokemon</p>
    </div>
    )
  }
}

export default Pokemon;

const styles = {
  container: {
    alignContent: 'center',
    padding: '10rem'
  },
  img: {
    height: '30rem',
    width: '35rem',
